void ApplicationSlider_OnSetValue( ApplicationSlider _this, XInt32 value )
{
  if ( value < 0 )
    value = 0;

  if ( value > 100 )
    value = 100;

  if ( _this->Value == value )
    return;

  _this->Value = value;
  CoreGroup_InvalidateViewState((CoreGroup)_this );
}

