{
  XInt32 oldValue = _this->Value;

  if ( sender == ((XObject)&_this->KeyPlusHandler ))
    ApplicationSlider_OnSetValue( _this, _this->Value + 1 );

  if ( sender == ((XObject)&_this->KeyMinusHandler ))
    ApplicationSlider_OnSetValue( _this, _this->Value - 1 );

  if ( oldValue != _this->Value )
    EwSignal( _this->OnChange, ((XObject)_this ));
}

